import React, { Component } from 'react';
import { Form, ButtonGroup, Button, Popover, OverlayTrigger, Alert } from 'react-bootstrap';
import { Link } from 'react-router-dom';

class PersonalInfo extends Component{

  constructor(props) {
   super(props);

   this.state = {
     directly:null,
     indirectly: null
   }
   // This binding is necessary to make `this` work in the callback
   this.saveAndContinue = this.saveAndContinue.bind(this);
  }

  componentWillMount(){
     this.initializePopovers();
  }

    saveAndContinue = (e, value) => {
        e.preventDefault();
        this.props.nextStep();
        this.props.handleInfoChange(value);
    }

    back  = (e) => {
      e.preventDefault();
      this.props.prevStep();
    }

    createType = (isPersonalInfo) => {
      return ({
        type : this.props.currentForm,
        location: 'Canada',
        isPerfonalInfo: isPersonalInfo

      })
    }

    initializePopovers = () => {
      const processor = (
        <Popover id="popover-basic">
          <Popover.Title as="h3">Data Processor</Popover.Title>
          <Popover.Content>
            Individual, entity or organization that either personally or through
            a project collects, records, organizes, structures, stores, adapts
            or alters, retrieves, consults, uses, discloses, transmits,
            disseminates or otherwise makes available, aligns, combines,
            restricts, erases or destroys data.
          </Popover.Content>
        </Popover>);

        const recipient = (
          <Popover id="popover-basic">
            <Popover.Title as="h3">Data Recipient</Popover.Title>
            <Popover.Content>
              Any person to whom the data is disclosed in accordance with a data access
              agreement either open, controlled or registered.
              These are usually researchers, research centres or companies who
              will use the data for further research.
            </Popover.Content>
          </Popover>);

          const donor = (
            <Popover id="popover-basic">
              <Popover.Title as="h3">Data Donor</Popover.Title>
              <Popover.Content>
                Refers to the individual whom the data is about.
              </Popover.Content>
            </Popover>);

      this.setState({
        processor: processor,
        recipient: recipient,
        donor: donor
      });
    }

    render(){
        const popover = (
          <Popover id="popover-basic">
            <Popover.Title as="h3">Directly Identifiable</Popover.Title>
            <Popover.Content>
              Information that <strong>identifies a specific individual </strong>
              using direct identifiers (name, social insurance number, etc.)
            </Popover.Content>
          </Popover>
        );
        const popover2 = (
            <Popover id="popover-basic">
              <Popover.Title as="h3">Indirectly Identifiable</Popover.Title>
              <Popover.Content>
                Information that <strong>in combination with indirect identifiers</strong>
                (date of birth or place of residence) can be reasonable expected to identify
                a specific human being.
              </Popover.Content>
            </Popover>
          );
        const { values } = this.props;
        return(
          <div>
            <h1> Is it personal information? </h1>
            <Alert variant='info' style={{paddingBottom: '1%'}}> Locations selected: {this.props.locations.toString()}</Alert>
            <h4 style={{paddingBottom: '1%'}}> Is the information
             <OverlayTrigger trigger="hover" placement="right" overlay={popover}>
                <Alert.Link> Directly</Alert.Link>
              </OverlayTrigger> or
               <OverlayTrigger trigger="hover" placement="right" overlay={popover2}>
                <Alert.Link> Indirectly </Alert.Link>
               </OverlayTrigger>
              Identifiable? </h4>
            <ButtonGroup style={{width:'100%'}} size="lg" vertical>
              <Button variant="light" onClick={(e) => this.saveAndContinue(e, this.createType(true) )}>Yes</Button>
              <Button variant="light" onClick={(e) => this.saveAndContinue(e, this.createType(false))}>No</Button>
            </ButtonGroup>
            <div style={{paddingTop: '3%'}}>
              <Button variant={'warning'} onClick={(e) => this.back(e)}> Back </Button>
              <Link to="/">
                <Button variant="danger"> Restart  </Button>
              </Link>
            </div>
          </div>
        )
    }
}

export default PersonalInfo;
